sys_variable_value.value:
(function execute(inputs, outputs) {

  var eccGr = new GlideRecord('ecc_queue');
  eccGr.initialize();
  eccGr.agent = 'mid.server.' + inputs.midServerName;
  eccGr.topic = 'Command';
  eccGr.source = 'GetEventLogs';
  eccGr.queue = 'output';
  eccGr.state = 'ready';
  var value = "powershell scripts\\PowerShell\\VeeamApp\\GetEventLogs.ps1 " + inputs.lastEventIndex;
  eccGr.payload = '<?xml version="1.0" encoding="UTF-8"?><parameters><parameter name="name" value="' + value + '"/><parameter name="skip_sensor" value="true"/></parameters>';
  outputs.eccqueuesysid = eccGr.insert();

})(inputs, outputs);

